pub fn minimum_length(s: String) -> i32 {
    let mut map = [0; 26];
    for c in s.chars() {
        let i = c as usize - 97;
        map[i] += 1;
        if map[i] == 3 {
            map[i] -= 2;
        }
    }

    map.iter().fold(0, |a, x| a + x)
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn example_1() {
        let result = minimum_length("abaacbcbb".to_owned());
        assert_eq!(result, 5);
    }

    #[test]
    fn example_2() {
        let result = minimum_length("aa".to_owned());
        assert_eq!(result, 2);
    }

    #[test]
    fn example_3() {
        let result = minimum_length("".to_owned());
        assert_eq!(result, 40)
    }
}
